a:260:{i:0;a:1:{s:2:"id";s:19:"2390906653995304363";}i:1;a:1:{s:10:"short_code";s:11:"CEuNO8qggWr";}i:2;a:1:{s:12:"created_time";i:1599238305;}i:3;a:1:{s:7:"caption";s:1308:"Tread. 

You cannot sit on the fence forever. There will be a day that you need to pick a specific path. That means you need to start understanding your beliefs now so that you can choose wisely. 

There are others that are 10 steps ahead of you right now. They have chosen their path and a lot of them are against you. No one can stay indifferent when they start coming after your beliefs. 

The enemy will begin treading over you if you do not tread over them first. Are you going to pick the easiest trail like they did? Or will you take the trail that makes you stronger? Your enemies want you to join them on the simplest path or they want to rip you away from your own. 

Understand your opinions and beliefs completely. Know exactly what you want to fight for and defend it with your life. Do not back down for anyone. You will make enemies, but you have prepared for that. In this world there is a lack of strong leaders that know exactly what they believe in. You need to become a strong leader.

Climb that mountain and keep your beliefs close to you. Do not let anyone lead you astray. Yes you will fall, but that doesn't mean you find an easier way. You will only strengthen your mind, body, and spirit by taking this path. 

Start Treading. 

